import Layout from '../components/layout.js';

export default function Index() {
  return (
    <Layout>
      <div className="intro">
        <p>To whom it may deeply concern,</p>
        <p>I am guessing that you meant to come here, rather than it being a massive coincidence that you typed in a random URL and landed on this page, in which case, what are the chances of that?</p>
        <p><b>Disclaimer</b>: that was a retorical question, although if you are so inclined to work it out, be my guest.</p>
        <p>Welcome to the sometimes interesting, otherwise nonsensical rantings of a software developer.</p>
        <p>I hope you enjoy your satay, if you're having a Chinese meal, otherwise I hope you enjoy your stay.</p>
        <p><b>Disclaimer</b>: Yes, I wrote stay wrong initially, but decided to keep it and incorporate it.</p>
        <p>Kindest of regards,</p>
        <p>Gareth.</p>
      </div>
    </Layout>
  );
}
